export default function Textbox(props) {
  return (
    <>
    <div className="form-floating" rows="10">
        <h1>{props.title}</h1>
    <textarea className="form-control" placeholder="Leave a comment here" id="floatingTextarea2" ></textarea>
    </div>
    </>
  )
}
